css:
.sheet-toolbar {
  border-bottom: 1px solid #2c2c2c;
  box-shadow: none;
}
.thread-icon:not(.thread-icon-unread):not(.thread-icon-star) {
  -webkit-filter: invert(100%);
}
img.content-dark {
  -webkit-filter: invert(100%);
}
img.content-light {
  -webkit-filter: invert(100%);
}
.mail-label {
  -webkit-filter: contrast(110%) brightness(85%);
}
#message-list .message-item-wrap .message-item-white-wrap {
  box-shadow: 0 0 0.5px rgba(255, 255, 255, 0.28), 0 1px 1.5px rgba(255, 255, 255, 0.08);
}
.thread-list .list-item:not(.unread):not(.selected):not(.focused) {
  color: #aaa;
}
.category-mapper-container {
  width: 40%;
  min-width: 460px;
  margin: 0 auto;
}
.account-section-title {
  border-bottom: 1px solid #2c2c2c;
  margin: 13.5px 0;
}
input.search {
  border: 1px solid #000000;
  border-radius: 3px;
  background-color: #212121;
  box-shadow: inset 0 1px 0 rgba(0, 0, 0, 0.05), 0 1px 0 rgba(0, 0, 0, 0.05);
  color: #eee;
  padding-left: 0;
  background-repeat: no-repeat;
  background-image: url('../static/images/search/searchloupe@2x.png');
  background-size: 15px 15px;
  background-position: 7px 4px;
  text-indent: 31px;
}
.role-section {
  display: flex;
}
.role-section .col-left {
  color: rgba(238, 238, 238, 0.6);
  text-align: right;
  flex: 1;
  margin-right: 20px;
}
.role-section .col-right {
  text-align: left;
  margin-bottom: 5px;
  flex: 1;
}
